import React from 'react'
import todo from "../images/todo.webp";

const Todo = () => {
  return (
    <div style={{margin:"200px"}}  className="main-div">
       <div className='child-div'>
         <figure style={{margin:"500px"}} >
            <img  src={todo} alt="todologo"/>
         </figure>
        </div>
    </div>
  )
}

export default Todo
